from queue import PriorityQueue


# Directions are represented as (dx, dy) for each of the four directions: East, North, West, South
DIRS = [(0, 1), (-1, 0), (0, -1), (1, 0)]  # E, N, W, S

# Helper function to check if a move is within the bounds and not a wall
def is_valid_move(maze, x, y):
    return 0 <= x < len(maze) and 0 <= y < len(maze[0]) and maze[x][y] != '#'

# BFS to find the minimum score
def min_score_to_reach_end(maze):
    # Find start (S) and end (E) positions
    start = None
    end = None
    for i in range(len(maze)):
        for j in range(len(maze[0])):
            if maze[i][j] == 'S':
                start = (i, j)
            elif maze[i][j] == 'E':
                end = (i, j)
    
    # Initialize BFS queue with all four possible starting orientations (East, North, West, South)
    queue = PriorityQueue()
    queue.put((0, start[0], start[1], 0))  # (score, x, y, direction)
    visited = set((start[0], start[1], 0))  # (x, y, direction) visited state

    while queue:
        score, x, y, dir = queue.get()

        # If we reached the end position, return the score
        if (x, y) == end:
            return score

        # 1. Move forward
        dx, dy = DIRS[dir]
        nx, ny = x + dx, y + dy
        if is_valid_move(maze, nx, ny):
            if (nx, ny, dir) not in visited:
                visited.add((nx, ny, dir))
                queue.put((score + 1, nx, ny, dir))  # Moving forward adds 1 to the score

        # 2. Rotate clockwise (90 degrees)
        new_dir = (dir + 1) % 4
        if (x, y, new_dir) not in visited:
            visited.add((x, y, new_dir))
            queue.put((score + 1000, x, y, new_dir))  # Rotating adds 1000 to the score

        # 3. Rotate counterclockwise (90 degrees)
        new_dir = (dir - 1) % 4
        if (x, y, new_dir) not in visited:
            visited.add((x, y, new_dir))
            queue.put((score + 1000, x, y, new_dir))  # Rotating adds 1000 to the score

    # If we couldn't reach the end, return -1 (though the problem ensures there's always a solution)
    return -1

